// Get raw string output
const raw = $json.output || "";

// Remove Markdown code block wrapping
const cleaned = raw
  .replace(/^```json/, "")   // remove starting ```json
  .replace(/^```/, "")       // in case it's just ```
  .replace(/```$/, "")       // remove ending ```
  .trim();

// Try to parse it to JSON
let parsed;
try {
  parsed = JSON.parse(cleaned);
} catch (err) {
  throw new Error("Failed to parse cleaned OpenAI output as JSON");
}

return [
  {
    json: parsed
  }
];
